import React, { Component } from 'react';
import {StyledNavbar} from './style'

export default class Navbar extends Component {
   constructor(props) {
     super(props)
   }
   render() {
      return(
            <StyledNavbar>
                <span>Brand</span> 
                <div>
                    <div>About me</div>
                    <div>Projects</div>
                </div> 
            </StyledNavbar>
      )
   }
}
